import { Link } from "react-router-dom";
import "./navbar.css"

const Nabvar = () => {
    return (
        <div className="navbar">
            <ul>
                <li><Link to="/"></Link>Home</li>
                <li><Link>Projects</Link></li>
                <li><Link>Resume</Link></li>
                <li><Link>Contact Me</Link></li>
            </ul>
        </div>
    )
}

export default Nabvar;
